Method.Source:
[Form]
public class ProdJournalPickingListLineSummary extends FormRun
{
    InventDimCtrl_Frm               inventDimFormSetup;
}

public void init()
{
    if (!element.args().dataset())
    {
        throw error(strFmt("@SYS22678", this.name()));
    }

    super();

    element.updateDesign(InventDimFormDesignUpdate::Init);
}

/// <summary>
///    Modifies form controls according to dimensions display settings.
/// </summary>
/// <param name="mode">
///    The mode the method is called with. For this form, only Init makes sense. If this form is modified, please add the other modes.
/// </param>
private void updateDesign(InventDimFormDesignUpdate mode)
{
    switch (mode)
    {
        case InventDimFormDesignUpdate::Init        :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup = InventDimCtrl::newFromFormValidDataSource(element, InventDim_ds.name());
            }
            inventDimFormSetup.formSetControls(true, true);

            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}
